import React from 'react'
import { link } from 'react-router-dom'

const Navbar = () => {
    return (
        <nav className="nav-wrapper blue darken-3">
            <div classname="container">
                <Link to="/" classname="brand-logo"></Link>
            </div>
        </nav>
    )
}

export default Navbar
